import React from "react";
import Header from "./Header";
import Store from "./Store/Store";
import Footer from "./Footer"
import CartProvider from "./Context/CartProvider";
const STORE = () => {
  return (
    <CartProvider>
      <Header/>
      <Store/>
      <Footer/>
    </CartProvider>
  );
};

export default STORE;
